import React from 'react';
import { Dialog, DialogTitle, DialogContent, DialogActions, Button, TextField, DialogContentText } from "@material-ui/core";
import { createMuiTheme } from "@material-ui/core/styles";
import { green } from "@material-ui/core/colors";

const StudentAddMarksDialog = props => {
  const { isMarksDialogOpen, isMarksEdit, addOrEditMarksOpenHandler } = props;
  return (
    <Dialog open={isMarksDialogOpen} onClose={() => addOrEditMarksOpenHandler(isMarksEdit, !isMarksDialogOpen)} aria-labelledby="form-dialog-title">
      <DialogTitle id="form-dialog-title">Subscribe</DialogTitle>
      <DialogContent>
        <DialogContentText>
          To subscribe to this website, please enter your email address here. We will send updates
          occasionally.
        </DialogContentText>
        <TextField
          autoFocus
          margin="dense"
          id="name"
          label="Email Address"
          type="email"
          fullWidth
        />
      </DialogContent>
      <DialogActions>
        <Button onClick={() => addOrEditMarksOpenHandler(isMarksEdit, !isMarksDialogOpen)} color="primary">
          Cancel
        </Button>
        <Button onClick={() => addOrEditMarksOpenHandler(isMarksEdit, !isMarksDialogOpen)} color="primary">
          Subscribe
        </Button>
      </DialogActions>
    </Dialog>
  );
}

export default StudentAddMarksDialog;
